  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:34.105571\",\n\t\"name\": \"yfnwr-project-report-number-85-3-beaver-food-cache-survey-yukon-flats-national-wildlife-re\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of the annual beaver food
  cache survey is to determine trends in the relative abundance of beaver in representative
  drainages within the Yukon Flats National Wildlife Refuge. Eventually, estimates
  of beaver populations will be used to evaluate annual beaver harvest in terms of:
  how closely harvest approaches optimum sustained yield; whether or not optimum aged
  beaver are harvested; and whether or not particular areas may be over-harvested
  and beaver populations need to be protected or restored. The methods and materials
  and results and discussion are included.\",\n\t\"license_title\": \"License Not
